import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import Login from "./Component/Login";
import Homepage from "./Component/Homepage";
import Logout from './Component/Logout';
import Register from './Component/Register';
import Forget from './Component/ForgetPassword';
import History from './Component/History';
export const routes = [
  {
    path: "/",
    exact: true,
    component: Homepage
  },
  {
    path: "/login",
    exact: true,
    component: Login
  },
  {
    path: "/register",
    exact: true,
    component: Register
  },
  {
    path: "/forgotPassword",
    exact: true,
    component: Forget
  },
  {
    path: "/dashboard",
    name: "Home",
    component: Homepage,
    icon: "dashboard",
    nav: true
  },{
    path: "/campaign",
    name: "Campaign",
    icon: "star",
    nav: true,
    subPage: [
      {
        path: "/manager",
        name: "Management",
        component: Homepage,
        icon: "audit"
      },
      {
        path: "/badges",
        name: "Badge Images",
        component: Login,
        icon: "picture"
      }
    ]
  },
  {
    path: "/invitation",
    name: "Invitation",
    icon: "user-add",
    nav: true,
    subPage: [
      {
        path: '/invitation',
        name: 'Send Invitation',
        //component: Login,
        icon: 'user-add',
      },
      {
        path: '/invited',
        name: 'Invited User',
        //component: Login,
        icon: 'user-add',
      },
    ]
  },
  {
    path: "/History",
    name: "History",
    component: Login,
    icon: "dollar",
    nav: true
  },
  {
    path: "/Hisory",
    name: "MyCart",
    component: Login,
    icon: "dollar",
    nav: true
  },
  {
    path: "/account",
    name: "Account",
    icon: "user",
    nav: true,
    subPage: [
      {
        path: "/Profile",
        name: "Profile",
        //component: Login,
        icon: "user"
      },
      {
        path: "/changePassword",
        name: "Change Password",
        //component: Login,
        icon: "user"
      }, {
        path: "/logout",
        name: "Logout",
        component: Logout,
        icon: "logout",
        nav: true
      }
    ],
  },
];

export const AppRouter = props => {
  return (
    <Router>
      <Switch>
        {routes.map((route, i) =>
          route.subPage ? (
            route.subPage.map((sub, j) => (
              <Route
                key={`${i}_${j}`}
                {...sub}
                path={`${route.path}${sub.path}`}
              />
            ))
          ) : (
            <Route key={i} {...route} />
          )
        )}
      </Switch>
    </Router>
  );
};
